// Blog.tsx
import { FC } from 'react';

const Blog: FC = () => {
    return (
        <div  id="service" class="kioto_tm_section">
            <h1>// My Blog</h1>
            <p>Check out my latest blog posts on dev.to:</p>
            <a 
                href="https://dev.to/your-username" 
                target="_blank" 
                rel="noopener noreferrer"
            >
                Visit My dev.to Blog
            </a>
        </div>
    );
}

export default Blog;
